#   https://leetcode.com/problems/valid-anagram

#   https://leetcode.com/problems/valid-anagram/solution


from collections import Counter


class Solution:
    #   92.91%
    def isAnagram0(self, s, t):
        if (s and t is None) or (s is None and t) or len(s) != len(t):
            return False
        if 0 == len(s) == len(t):
            return True
        d = {}
        for c in s:
            if c in d:
                d[c] += 1
            else:
                d[c] = 1
        for c in t:
            if c in d:
                d[c] -= 1
            else:
                return False
        return all([i == 0 for i in d.values()])

    #   https://leetcode.com/explore/challenge/card/february-leetcoding-challenge-2021/585/week-2-february-8th-february-14th/3636
    #   runtime; 40ms, 89.91%
    #   memory; 14.4MB, 77.94%
    def isAnagram(self, s: str, t: str) -> bool:
        return Counter(s) == Counter(t)


solution = Solution()
data = [('anagram', 'nagaram', True),
        ('rat', 'car', False),
        ('', '', True),
        ("", "", False),
        ]
for s, t, expect in data:
    real = solution.isAnagram(s, t)
    if len(s) < 10 and len(t) < 10:
        print(f'{s}, {t}, expect {expect}, real {real}, result {expect == real}')
    else:
        print(f'{s[:10]}..., {t[:10]}..., expect {expect}, real {real}, result {expect == real}')
